  function mail() {
    let lettersObject = {
      vowels: "shwnzkd".split(""),
      consonants: "ospse".split(""),
    };

    let length = randomInteger(2, lettersObject.vowels.length - 1);

    function randomInteger(min, max) {
      let rand = min - 0.5 + Math.random() * (max - min + 1);
      rand = Math.round(rand);
      return rand;
    }

    let email = "";
    for (let i = 0; i < length; i++) {
      email += lettersObject.vowels.splice(
        randomInteger(0, lettersObject.vowels.length - 1),
        1
      );
      email += lettersObject.consonants.splice(
        randomInteger(0, lettersObject.consonants.length - 1),
        1
      );
    }

    let domain = {
      2: ["qq", "gmail", "163", "sina", "139", "hotmail"],
      1: "com",
    };

    let mail =
      email +
      "@" +
      domain[2][Math.floor(Math.random() * Math.floor(domain[2].length))] +
      "." +
      domain[1];
    return mail;
  }

  function calc_suffix_d(base) {
    if (base.length != 17) {
      return "invalid id card length";
    }
    let factory = [7, 9, 10, 5, 8, 4, 2, 1, 6, 3, 7, 9, 10, 5, 8, 4, 2],
      sums = 0;

    for (let i = 0; i < 17; i++) {
      sums += base[i] * factory[i];
    }

    let mods = sums % 11;
    switch (mods) {
      case 0:
        return "1";
        break;
      case 1:
        return "0";
        break;
      case 2:
        return "X";
        break;
      case 3:
        return "9";
        break;
      case 4:
        return "8";
        break;
      case 5:
        return "7";
        break;
      case 6:
        return "6";
        break;
      case 7:
        return "5";
        break;
      case 8:
        return "4";
        break;
      case 9:
        return "3";
        break;
      case 10:
        return "2";
        break;
    }
  }
